// app.js - Gestione sfondi con variabili base64

// Variabili base64 per le immagini di sfondo
// Inserisci qui le tue immagini convertite in base64
document.addEventListener('DOMContentLoaded', function() {
// Sfondo principale (es. texture o pattern)
const backgroundBase64 = "data:image/jpeg;base64, ";
const avatarEliot = "data:image/jpeg;base64, ";   // Sostituisci

    // ---------- SFONDO PRINCIPALE ----------
 // app.js - Gestione sfondi e avatar in base64
// (mantieni invariate le definizioni delle variabili)

    // Crea un foglio di stile dinamico con tutte le regole CSS
 const style = document.createElement('style');
style.textContent = `
  /* Immagine di sfondo (primo livello) */
  .bg-image {
    background-image: url('${backgroundBase64}');
  }

  /* Avatar membri */
  #avatar3 { background-image: url('${avatarEliot}'); }
`;
document.head.appendChild(style);
    function applyBackgroundWithFallback(backgroundBase64) {
  const bgElement = document.querySelector('.bg-image');

  // Se non esiste variabile o  vuota  fallback immediato
  if (!backgroundBase64 || backgroundBase64.length < 50) {
    console.warn("Background non valido  attivo fallback");
    document.body.classList.add('bg-fallback');
    return;
  }

  const testImage = new Image();

  testImage.onload = function () {
    console.log("Background caricato correttamente");
    bgElement.style.backgroundImage = `url(${backgroundBase64})`;
    document.body.classList.add('bg-loaded');
  };

  testImage.onerror = function () {
    console.warn("Errore caricamento background  fallback attivo");
    document.body.classList.add('bg-fallback');
  };

  testImage.src = backgroundBase64;
}
    applyBackgroundWithFallback(backgroundBase64);

});






